signatures: >-
  get_bank_branches(bank_id: int) -> list[dict] - Fetches branches of a bank by
  its ID.

  get_bank_financials(bank_id: int) -> list[dict] - Retrieves financial
  information for a bank using its ID.

  get_bank_id_by_name(name: str) -> int - Gets the bank ID for a given bank
  name.

  create_workbook() -> openpyxl.Workbook - Creates a new Excel workbook.

  auto_size_column_width(worksheet: openpyxl.worksheet.worksheet.Worksheet) ->
  None - Adjusts column widths in the given worksheet for optimal display.

  add_worksheet(workbook: openpyxl.Workbook, sheet_name: str) ->
  openpyxl.worksheet.worksheet.Worksheet - Adds a new worksheet to the workbook
  with the specified name.

  add_table_rows(worksheet: openpyxl.worksheet.worksheet.Worksheet, start_row:
  int, start_col: int, rows: list[list], formats: list[str] = None) -> None -
  Adds rows of data to the worksheet starting at the specified cell, with
  optional cell formats.

  add_table_header(worksheet: openpyxl.worksheet.worksheet.Worksheet, row: int,
  col: int, column_names: list[str]) -> None - Adds a header row to the
  worksheet at the specified cell location.
